// src/sections/Loan.js
import React from 'react';
import '../styles/Loan.css';

const Loan = () => {
  return (
    <div className="loan-page">
      <h1>LOANS</h1>
      
      <div className="loan-buttons">
        <button>Personal Loan</button>
        <button>Home Loan</button>
        <button>Business Loan</button>
        <button>Car Loan</button>
        <button>Education Loan</button>
        
      </div>

      <div className="loan-section">
        <div className="loan-details">
          <h2>Loan Details</h2>
          <div className="loan-image"></div>
         <div className="loan-detail-line"></div>
<div className="loan-detail-line"></div>
<div className="loan-detail-line short"></div>

        </div>

        <div className="mortgage-calculator">
          <h2>loan Calculator</h2>
          <div className="calculator-box"></div>
        </div>
      </div>
    </div>
  );
};

export default Loan;
